import styled from 'styled-components'

export const DeleteButton = styled.button`
    text-decoration: none;
    border: none;
    height: 15px;
    font-size: 10px;
    background-color:#DC143C;
    color:white;
    box-sizing:border-box;
    border-radius:2px;
    margin: 2px 0px;

`
